Felt good to pop 🍾 again! P3 OA and back on the box at Ironman. A massive thanks to my @ktmusa @ktmfactoryracing team for never giving up and getting me dialed in. It was nice to make passes and lead laps this week and my fastest lap in the races with two laps to go in Moto 2 shows my fitness is where it needs to be. 2 to go… let’s keep it rolling 💪🏽

@ktmusa @redbull @thormxofficial @bellhelmets @100percent_moto @alpinestarsmx @paradiseautos @iamspecialized

📸 @align.with.us

P5 OA at Budds Creek. There’s no doubt that it’s been a challenging summer, but getting these gate drops each week is huge and something I’ve lacked the past few summers. The atmosphere with fans back at the races has been unreal and there’s no choice but try and bring it each weekend 👊🏽💥

@ktmusa @ktmfactoryracing @redbull @thormxofficial @bellhelmets @100percent_moto @alpinestarsmx @paradiseautos @iamspecialized

📸 @align.with.us

The Mohawks and upstate NY fans turned out for Dilla! A 5-5 for 6th OA kinda day. Going to keep working til the mountains turn blue 💪🏽

@ktmusa @redbull @thormxofficial @bellhelmets @100percent_moto @alpinestarsmx @paradiseautos @iamspecialized

